import React from 'react'
import GraphVisualizer from '../Graph/GraphVisualizer'
import LinkedList from '../LinkedList/LinkedListVisualizer'
import Tree from '../Tree/TreeVisualizer'

//AlgoTab passes current tabKey so Algorithm knows which component to render
const Algorithm = (props) => {
    //Selected Algo Component is stored into this variable
    let selectedAlgo = null

    if (props.algoKey === 'LinkedList') {
        selectedAlgo = <LinkedList/>
    } else if (props.algoKey === 'Tree') {
        selectedAlgo = <Tree/>
    } else {
        selectedAlgo = <GraphVisualizer/>
    }

    return(
        <div>
            {selectedAlgo}
        </div>
    )
}

export default Algorithm
